import React, { useRef } from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  StyleSheet,
  Animated,
  Dimensions,
  Platform,
} from 'react-native';

const { width } = Dimensions.get('window');

const ProjectCard = ({ project, index }) => {
  const scaleAnim = useRef(new Animated.Value(1)).current;
  const glowAnim = useRef(new Animated.Value(0)).current;

  const handlePressIn = () => {
    Animated.parallel([
      Animated.spring(scaleAnim, {
        toValue: 1.05,
        useNativeDriver: true,
      }),
      Animated.timing(glowAnim, {
        toValue: 1,
        duration: 200,
        useNativeDriver: true,
      }),
    ]).start();
  };

  const handlePressOut = () => {
    Animated.parallel([
      Animated.spring(scaleAnim, {
        toValue: 1,
        useNativeDriver: true,
      }),
      Animated.timing(glowAnim, {
        toValue: 0,
        duration: 200,
        useNativeDriver: true,
      }),
    ]).start();
  };

  return (
    <TouchableOpacity
      activeOpacity={0.9}
      onPressIn={handlePressIn}
      onPressOut={handlePressOut}
    >
      <Animated.View
        style={[
          styles.projectCard,
          {
            transform: [{ scale: scaleAnim }],
          },
        ]}
      >
        <Animated.View
          style={[
            styles.cardGlow,
            {
              opacity: glowAnim,
            },
          ]}
        />

        <View style={styles.cardContent}>
          <View style={styles.cardHeader}>
            <Text style={styles.cardIcon}>{project.icon}</Text>
            <Text style={styles.cardTitle}>{project.title}</Text>
          </View>

          <Text style={styles.cardDescription}>{project.description}</Text>

          {project.tech && (
            <View style={styles.techStack}>
              {project.tech.map((tech, idx) => (
                <View key={idx} style={styles.techBadge}>
                  <Text style={styles.techText}>{tech}</Text>
                </View>
              ))}
            </View>
          )}

        </View>
      </Animated.View>
    </TouchableOpacity>
  );
};

const ProjectsSection = () => {
  const projects = [
    {
      id: 1,
      icon: 'ü•ó',
      title: 'DietAI - 7-FIGURE EXIT',
      description: 'AI-powered calorie tracking mobile app. Joined as technical consultant to fix critical bugs and optimize performance, directly contributing to successful 7-figure private equity acquisition.',
      tech: ['Swift', 'React Native', 'Python'],
    },
    {
      id: 2,
      icon: 'üè¢',
      title: 'B2B SaaS - Onboarding Platform',
      description: 'Currently developing POC and MVP for streamlining new hire onboarding. Building full-stack solution to showcase to customers and investors for seed funding.',
      tech: ['React Native', 'Python', 'Golang'],
    },
    {
      id: 3,
      icon: 'ü§ñ',
      title: 'AI Supply Chain Consulting',
      description: 'Helped established entrepreneur optimize supply chain operations through AI integration. Taught practical implementation of AI tools for self-sufficient management and decision-making.',
      tech: null,
    },
    {
      id: 4,
      icon: '‚õ≥',
      title: 'Dawn Patrol - Golf App',
      description: 'Built from scratch for amateur weekend golfers. Complex UI/UX challenge with no existing solutions to reference. Created intuitive interface for group management, handicap tracking, and social betting.',
      tech: ['React Native', 'Firebase', 'Golang', 'Custom UI'],
    },
    {
      id: 5,
      icon: 'üêæ',
      title: 'Royal Paws - Pet Grooming',
      description: 'Full-stack web and mobile solution for mobile grooming business. Architecture designed to scale from 1 to 50+ vans. Automated scheduling, route optimization, and customer management.',
      tech: ['Next.js', 'React Native', 'PostgreSQL', 'Stripe', 'Golang'],
    },
    {
      id: 6,
      icon: 'üí¨',
      title: 'ECS-ChatBot - University MVP',
      description: 'Personal project built in 2023 showcasing early adoption of RAG and vector embeddings. Demonstrated ability to quickly leverage emerging AI technologies to solve real problems.',
      tech: ['LangChain', 'Pinecone', 'Python', 'OpenAI API'],
    },
  ];

  return (
    <View style={styles.container}>
      <Text style={styles.sectionTitle}>RECENT PROJECTS</Text>
      <View style={styles.fireBar} />

      <Text style={styles.sectionSubtitle}>
        Real projects. Real results. Real revenue.
      </Text>

      <View style={styles.projectsGrid}>
        {projects.map((project, index) => (
          <ProjectCard key={project.id} project={project} index={index} />
        ))}
      </View>

    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: '#0A0A0A',
    paddingVertical: 80,
    paddingHorizontal: width > 768 ? 40 : 20,
    borderTopWidth: 2,
    borderTopColor: '#8B0000',
  },
  sectionTitle: {
    fontFamily: Platform.OS === 'web' ? "'Press Start 2P', monospace" : 'monospace',
    fontSize: width > 768 ? 36 : 24,
    color: '#FF4500',
    textAlign: 'center',
    marginBottom: 20,
    textShadowColor: '#FF4500',
    textShadowOffset: { width: 0, height: 0 },
    textShadowRadius: 20,
  },
  fireBar: {
    height: 4,
    width: 100,
    backgroundColor: '#FF4500',
    alignSelf: 'center',
    marginBottom: 20,
    borderRadius: 2,
    ...Platform.select({
      web: {
        boxShadow: '0 2px 20px rgba(255, 69, 0, 0.8)',
      },
      default: {
        shadowColor: '#FF4500',
        shadowOffset: { width: 0, height: 2 },
        shadowOpacity: 0.8,
        shadowRadius: 20,
      },
    }),
  },
  sectionSubtitle: {
    fontFamily: Platform.OS === 'web' ? "'Orbitron', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 18 : 14,
    color: '#CCCCCC',
    textAlign: 'center',
    marginBottom: 50,
  },
  projectsGrid: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'center',
    gap: 30,
    maxWidth: 1200,
    alignSelf: 'center',
  },
  projectCard: {
    backgroundColor: '#1A1A1A',
    borderRadius: 12,
    borderWidth: 2,
    borderColor: '#8B0000',
    overflow: 'hidden',
    width: width > 768 ? 480 : '100%',
    maxWidth: 500,
    position: 'relative',
  },
  cardGlow: {
    position: 'absolute',
    top: -2,
    left: -2,
    right: -2,
    bottom: -2,
    borderRadius: 12,
    borderWidth: 2,
    borderColor: '#FF4500',
    ...Platform.select({
      web: {
        boxShadow: '0 0 30px rgba(255, 69, 0, 0.8)',
      },
      default: {
        shadowColor: '#FF4500',
        shadowOffset: { width: 0, height: 0 },
        shadowOpacity: 0.8,
        shadowRadius: 30,
      },
    }),
  },
  cardContent: {
    padding: 25,
  },
  cardHeader: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 15,
  },
  cardIcon: {
    fontSize: 28,
    marginRight: 10,
  },
  cardTitle: {
    fontFamily: Platform.OS === 'web' ? "'Press Start 2P', monospace" : 'monospace',
    fontSize: width > 768 ? 16 : 14,
    color: '#FFA500',
    flex: 1,
  },
  cardDescription: {
    fontFamily: Platform.OS === 'web' ? "'Orbitron', sans-serif" : 'sans-serif',
    fontSize: 14,
    color: '#CCCCCC',
    lineHeight: 22,
    marginBottom: 20,
  },
  techStack: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    gap: 8,
    marginBottom: 20,
  },
  techBadge: {
    backgroundColor: 'rgba(255, 69, 0, 0.2)',
    paddingHorizontal: 12,
    paddingVertical: 6,
    borderRadius: 4,
    borderWidth: 1,
    borderColor: '#FF4500',
  },
  techText: {
    fontFamily: Platform.OS === 'web' ? "'Orbitron', sans-serif" : 'sans-serif',
    fontSize: 11,
    color: '#FFA500',
    fontWeight: '600',
  },
});

export default ProjectsSection;
